キレイキレイ お手ふきウェットシート ノンアルコールタイプ 30枚<br>ブランド：キレイキレイ<br>販売・製造元：ライオン<br><br>手・指の汚れ・バイ菌をしっかり拭き取り、除菌するウエットティッシュです。<br>外出先や車の中などで、いつでも簡単に、手・指を除菌し、清潔にすることができます。<br>しっかりしたメッシュシートを使用しています。<br>パッチテスト済み。<br>※すべての方に皮ふ刺激が起きないというわけではありません。<br> <br><br><br>使用方法<br>●シートを取りだし、手・指などをふいてください。<br>●乾燥による品質の劣化を防ぐため、使用後は必ずシールを閉めてください。<br>開封後はなるべくお早めにお使いください。<br> ご注意<br>●粘膜や目のまわりへの使用は避け、除毛直後や傷、はれもの、湿疹等、異常のあるときは使わない。<br>●使用中または使用後、赤み、かゆみ、刺激等の異常が現れたときは使用を中止し、商品を持参し医師に相談する。<br>●シートは水に溶けないので、水洗トイレには流さない。<br>●高温になるところや、直射日光のあたる場所には置かない。<br>●夏場の車内で使う場合は車内に放置せず、携帯する。<br>●乳幼児の手の届かないところに保管する。<br>*パッチテスト済み(すべての方に皮ふ刺激が起きないというわけではありません) 成分水、BG、PG、メチルパラベン、ココイルアルギニンエチルPCA(除菌成分)、モモ葉エキス 材質レーヨン、PP、PE ノロウイルス(ノロウィルス)対策全部とはノロウイルス(ノロウィルス)の感染の予防に役立つ商品です。<br>予防のポイント・牡蠣などの二枚貝を十分に加熱調理してください。<br>牡蠣などでは中心部が85度1分間以上に加熱すれば、感染性がなくなります。<br>・調理従事者・介助等職員では、手洗いの徹底が有効です。<br>ノロウイルスはアルコールなどの消毒では十分な効果が期待できないため、石けんと水の力で洗い流すことが重要になります。<br>・調理器具などは0.02%の次亜塩素酸ナトリウム、または温湯で85度1分以上の加熱をして消毒を行います。<br>・感染者の嘔吐物や糞便にはノロウイルスが含まれています。<br>これらを処理する場合はペーパータオル等で取り除き、ビニール袋などに密封して捨ててください。<br>0.1%の次亜塩素酸ナトリウムで汚染場所(広めに)を消毒します。<br>その際、処理する人が感染しないよう、使い捨て手袋、マスク、エプロンを着用して処理を行い、処理後は十分に手を洗ってください。<br><br>衛生医療／殺菌・消毒／除菌／除菌用ウエットティッシュ<br>JANコード： 4903301129479<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
