特別限定セット　どこでもベープＮｏ１未来セット　メタリックグレー　本体（器具１個＋取替１個）＋取り替えカードリッジ４個セット<br>どこでもベープＮＯ１未来取替用が４個ついてる超ロングランお買い得セット！２０日×５個入り＝１００日セット<br><br>セット内容：どこでもベープＮｏ１未来セットメタリックグレー　本体×１点（器具１個＋取替１個）、どこでもベープ未来取替用２個入×２点<br><br><br>どこでもベープNo.1 未来セット メタリックグレー<br>腕や足に巻いたり、腰に吊るしたり屋外で使える虫除けです。<br>1日6時間使用で20日間(120時間)使用できます。  <br><br>用途：屋外 <br><br>使用方法<br>1.トップカバー(グレーの部分)のどちらか一方に指を引っ掛けて上方向に外します。<br>2.薬剤を器具にのせます。(薬剤は固定できませんが問題ありません。)<br>※薬剤に裏表はありません。<br>3.トップカバーを元通りにセットします。カチッとロックされるまで上から押さえます)<br>4.器具を裏返して、電池カバーを持ち上げて外します。<br>5.電池方向を間違えないように中止してセットした後、本体側の凹みと電池カバー内部の凸部を併せて、カバーのロックがカチッとはまるまでしっかり閉めます。<br>6.スイッチをONにします。ランプが点灯し、薬剤が拡散します。スイッチをいれた直後や屋外で風がある場合等は、充分な効果が得られないことがあります。<br>※ランプが点灯しなくなったら電池と薬剤の両方を交換してください。<br>●ストレッチベルト取り付け部1.器具の裏面を上にした状態で「VAPE」の文字がある面を内側にして、ベルトの両端を先端だけ器具に通します。<br>2.ベルトと器具の間に腕を通します。3.ベルトの両端を接着部の方向に折り返して固定します。両端がそれぞれ腕に合わせて調節してください。<br>※小さなお子様の場合「VAPE」の文字の横にある接着部に反対の先端を重ねるようにして付ける。<br>●使用の目安ひと1人分の範囲<br>●使用期間120時間(1日6時間の使用で約20日間)使用できます。 <br><br> 使用上の注意<br>●定められた使用方法を必ず守る。<br>●使用中及び使用後は乳幼児・小児が薬剤に触れることのないように注意する。 適用害虫ユスリカ、チョウバエ  <br><br>廃棄方法<br>●使用後の薬剤はプラスチックごみとして、電池は適切な方法で捨てる。 <br> 原産国：日本 保管および取扱い上の注意<br>・直射日光、高温をさけて、小児の手の届かない場所に保管する。<br>・長期にわたり使用しない場合は、薬剤と電池を器具から外し、薬剤はラップやポリ袋などで密閉して電池とともに冷暗所に保管する。<br>・使用済みの電池はすみやかに器具から外す。電池が液漏れするおそれがあります。<br>※必要に応じて読めるように台紙を保管すること。<br><br> お問い合わせ先：<br>フマキラー株式会社 お客様相談室：0077-788-555/03-3255-6400  <br><br>販売_製造元： フマキラー<br>ブランド：どこでもベープ<br><br>商品番号：101-90099<br><br>JAN：4902424439441<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
